import AccountCircleOutlinedIcon from "@mui/icons-material/AccountCircleOutlined";
import AppsOutlinedIcon from "@mui/icons-material/AppsOutlined";
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined";
import { IconButton } from "@mui/material";
import React from "react";
import "tailwindcss/tailwind.css";

const FooterIcon = ({ Icon , text }) => {
  <IconButton
    sx={{ padding: "4px", borderRadius: "5px", color: "red" }}
  >
    <p className="text-xs">{text}</p>
  </IconButton>;
};

const Footer = () => {
  return (
    <footer className="fixed drop-shadow-header-shadow bottom-0 left-0 z-[100] w-full py-3 px-5 bg-slate-300 flex items-center justify-between">
      <IconButton sx={{ color: "green", borderRadius: "5px" }}>
        <HomeOutlinedIcon sx={{ color: "red" }} />
        <p className="text-xs">Home</p>
      </IconButton>
      <IconButton sx={{ borderRadius: "5px" }}>
        <AppsOutlinedIcon />
        <p>Category</p>
      </IconButton>
      <IconButton sx={{ borderRadius: "5px" }}>
        <AccountCircleOutlinedIcon />
        <p>Profile</p>
      </IconButton>
    </footer>
  );
};

export default Footer;
